import LayoutAfterLogIn from "./Layout_After_LogIn_Pacient/Layout_After_LogIn";
import {Route, Routes} from "react-router-dom";
import HomePage from './HomePage/HomePage'
function pacientHome(){
    return(
            <Routes>
                <Route
                    path="pacient/*"
                    element={
                        <LayoutAfterLogIn>
                            <HomePage/>
                        </LayoutAfterLogIn>
                    }
                />

            </Routes>
    );
}

export default pacientHome;
